/* jshint esversion: 6 */
import React from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;
export default function map() {
    defaultProps = {
        center: {lat: 59.95, lng: 30.33},
        zoom: 11
    };


    return(
        <div className='list_table' style={{ paddingLeft: '50px',height:'580px',marginLeft:'40px',width:'1100px',paddingRight:'50px',marginTop:'4px'}}>
            <script src="https://maps.googleapis.com/maps/api/js?key=AIzaSyB41DRUbKWJHPxaFjMAwdrzWzbVKartNGg&callback=initMap&v=weekly" defer/>
            <GoogleMapReact
                defaultCenter={this.props.center}
                defaultZoom={this.props.zoom}
            >
                <AnyReactComponent
                    lat={59.955413}
                    lng={30.337844}
                    text={'Kreyser Avrora'}
                />
            </GoogleMapReact>
        </div>
    )
}
